import React , { Component } from 'react';
import { Link } from 'react-router-dom';
import '../assets/Navigation.css';

class Navigation extends Component {
    render() {
        return (
            <div className="navBar">
                <ul className="navigation">
                    <li>HOME</li>
                    <li>BLOG</li>
                    <li>PORTFOLIO</li>
                </ul>
            </div>
        )
    } 
}

export default Navigation;
